import React from 'react';
import logo from "./images/logo"
import './index.css'

const Header = () => {
    return(
        <>
         <div className='header'>
         <img src = {logo} alt =" logo" width='70' height = '50' />
         <p>Keeper</p>
         </div>    
        </>
    )
}

export default Header;
